export default {
    change_auth ({commit}, auth) {
        commit('CHANGE_AUTH', auth);
    },
    user_info ({commit}, userData) {
        commit('USER_INFO', userData);
    },
    user_Personal_Info ({commit}, myData) {
        commit('CHANGE_USER_INFO', myData);
    }
}
